# ******************* DEFINING POSITION VECTORS *************************
xp = [0,160,340,440]
yp = [0,0,0,0]

# ********************** SENSITIVITIES VECTORS *************************
SDTfin = [-0.4E-4, -0.303E-4, -0.25E-4, -0.303E-4]
SDLg = [0.4545E-4, 0.303E-4, 0.1515E-4, 0.303E-4]
SDHfin = [-1.0638E-4, -0.303E-4, -0.133E-4, -0.303E-4]
VARmd = [4.3898E-24, 0.4818E-24, 0.0735E-24, 0.4818E-24]

# *********************** SIGMA VARIATIONS *************************
sigmaTfin = 6E-9
sigmaLg = 3E-9
sigmaHfin = 0.119E-9

VARg = numpy.zeros(len(xp))
for i in range(len(xp)):
    VARg[i] = (SDTfin[i] * sigmaTfin) ** 2 + (SDLg[i] * sigmaLg) ** 2 + (SDHfin[i] * sigmaHfin) ** 2

print("\n************************* POSITION MATRIX ********************\n")
# Correlation Matrix
d_ij = numpy.zeros((len(xp),len(yp)))
for i in range(len(xp)):
    for j in range(len(yp)):
        d_ij[(i,j)] = math.fabs(math.sqrt(xp[i]**2+yp[i]**2)-math.sqrt(xp[j]**2+yp[j]**2))
print(d_ij)

print("\n************************* SPATIAL CORRELATION MATRIX ********************\n")

KD2D = 0.2
KWID = 0.8
CDWID = 200

rho_m = numpy.zeros((len(xp),len(yp)))
for i in range(len(xp)):
    for j in range(len(yp)):
        rho_m[(i,j)] = KD2D + KWID*math.exp(-d_ij[(i,j)]/CDWID)
print(rho_m)

print("\n************************* CHOLESKY MATRIX ********************\n")
SpatialCorr = scipy.linalg.cholesky(rho_m, lower=False)
print(SpatialCorr)

print("\n************************* COVARIANCE MATRIX ********************\n")
COV = numpy.zeros((len(xp),len(yp)))

for i in range(len(xp)):
    for j in range(len(yp)):
        COV[(i,j)] = SDTfin[i] * SDTfin[j] * rho_m[(i, j)] * sigmaTfin ** 2 + SDLg[i] * SDLg[j] * rho_m[(i, j)] * sigmaLg ** 2 + SDHfin[i] * SDHfin[j] * rho_m[(i, j)] * sigmaHfin ** 2
        if i == j:
            COV[(i, j)] = VARmd[i]
        COV[(i, j)] = COV[(i,j)]*1e24
print(COV)

VARpath = 0
for i in range(len(xp)):
    for j in range(len(yp)):
       VARpath = VARpath + COV[(i,j)]

VARpath = VARpath
STDpath = math.sqrt(VARpath)

print(VARpath)
print(STDpath)

